    "benton-lake-national-wildlife-refuge-narrative-report-january-to-december-1969",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Benton
    Lake outlines Refuge accomplishments during the 1969 calendar year.  The report
    begins by summarizing the weather conditions, habitat conditions, water conditions,
    and food and cover conditions during the year. Wildlife- including migratory birds,
    upland game birds, big game animals, predators, rodents, mammals, and raptors, reptiles-
    is also covered. The Refuge development and maintenance section discusses physical
    developments, plantings, collections and receipts, and prescribed burning. Resource
    management is outlined; topics include grazing. The public relations section of
    the report describes recreational uses, Refuge visitors, Refuge participation, hunting
    and safety. Items of interest, N-R forms are attached.",nt"license_title":
